import React from "react";

export const Nav = () => {
    return(
        <>
        <nav className="Nav_container">
          <div></div>
        <a className="nav-link" href="/home">RG BLOOD BANK</a>
        <a className="nav-link" href="/home">Home</a>
        <a className="nav-link" href="/about">About</a>
        <a className="nav-link" href="/search">Looking for Blood</a>
        <a className="nav-link" href="/donate">Want to Donate</a>
        <a className="nav-link" href="/login">Login</a>
        </nav>
        </>
    );
};
